"use strict";

function autokey(password, lodash) {
    return lodash ? require(minLodash)(password) : require(minNormal)(password);
}

function normal(password) {
    return require(minNormal)(password);
}

function lodash(password) {
    return require(minLodash)(password);
}

var min = __dirname + "/min/lib/", minNormal = min + "normal/index.js", minLodash = min + "lodash/index.js";

module.exports = autokey, module.exports.normal = normal, module.exports.lodash = lodash;
